#!/usr/bin/env python
import sys
import qrcode
import cStringIO
import base64
import webbrowser
import subprocess
import argparse

# Parse the command line parameter(s)
parser = argparse.ArgumentParser(description='Render a printable version of an Electrum seed mnemonic phrase')
parser.add_argument('-w', '--wallet', type=str, help='Path of the wallet to pass to Electrum.')
parser.add_argument('-e', '--enterseed', action='store_true', help='Enter seed phrase manually')
args = parser.parse_args()
wallet = args.wallet
get_from_electrum = not args.enterseed

# Query Electrum for its version
version = subprocess.Popen("electrum version", shell=True, stdout=subprocess.PIPE).stdout.readline()

if get_from_electrum:
	# Query Electrum for its seed phrase.  Pass -w if a specific wallet file was requested
	# somehow, the getpass() call in Electrum is passed upwareds from the subprocess to the console. 
	command = "electrum getseed"
	if wallet: command += " -w " + wallet

	seed_proc = subprocess.Popen(command, shell=True, stdout=subprocess.PIPE)
	seed = seed_proc.stdout.readline()
else:
	print("Enter seed:")
	seed = sys.stdin.readline()

# Build the QR Code
qr = qrcode.QRCode(
    version=1,
    error_correction=qrcode.constants.ERROR_CORRECT_L,
    box_size=10,
    border=4,
)
qr.add_data(seed)
qr.make(fit=True)

# Make an image of the QRCode
img = qr.make_image()

# Convert the image to base64 for inlining into the HTML later.
buffer = cStringIO.StringIO()
img.save(buffer, format="png")
img_str = base64.b64encode(buffer.getvalue())

# Build the HTML template.  Use double-% when needed because will be used with the format operator later.
html = """<html>
<head>
<style>
	.mainarea {
		border-style: solid;
		border-width: 1pt; 
		border-color: black; 
		width: 678px; 
		height: 278px;
		position: relative;
	}
	.mainarea .qrcode {    
    	max-height: 260px;  
    	position: absolute;  
    	top: 0;  
    	bottom: 0;  
    	left: 0;  
    	right: 0;
    	margin-left: 150px;  
    	margin-top: auto;  
    	margin-bottom: auto;  
	}
	.seed {
		display: table;
    	top: 0;  
    	bottom: 0;  
    	left: 0;  
    	right: 0;
		position: absolute;
		font-family: Menlo, Monaco, Consolas, 'Courier New', monospace;
		top: 0;
		bottom: 0;
		right: 0;
		left: 0;
		margin-right: 20px;
		margin-top: auto;
		margin-bottom: auto;
		margin-left: 425px;
		padding: 20px;
		text-align: center;
	}
	.seed span {
		display: table-cell;
  		vertical-align: middle;
	}
	.mainarea .logo {
		max-height: 260px;
		position: absolute;
		width: auto;
		top: 0;
		bottom: 0;
		left: 0;
		right: 0;
		margin-left: 8px;
		margin-top: auto;
		margin-bottom: auto;
	}
	.logoarea {
		background-color: PALETURQUOISE;
		width: 100px;
		height: 278px;
	}
	.subtitle {
		font-family: sans-serif;
		font-weight: 500;
		font-size: 14pt;
		position: absolute;
    	top: 50%%;
    	left: 78px;
    	transform:  translateX(-50%%) translateY(-50%%) rotate(-90deg);
	}
	.seedicon {
		height: 16pt;
		width: auto;
	}
</style>
<title>
	Paper Wallet
</title>
</head>
<body>
<div class=mainarea>
	<div class=logoarea>
		<img class=logo src="data:image/png;base64,"/>
		<div class=subtitle>
			<img class=seedicon src="data:image/png;base64,"/>
			Electrum %s Wallet Seed
		</div>
	<div>
		<img class=qrcode src='data:image/png;base64,%s'/>
	</div>
	<div class=seed>
		<span>%s</span>
	</div>
</div>
</body></html>""" 

# Build the HTML
html = html % (version, img_str, seed)

# Encode the entire thing as base64 and pass to the default browser
b64url = "data:text/html;base64," + base64.b64encode(html)
if sys.platform == "darwin":
	webbrowser.get("Safari").open(b64url)
else:
	webbrowser.get("chromium-browser").open(b64url)
